def search_chests(latitude_local , longitude_local):
	common_counter=0 # bypass infinite loop
	r = requests.get(api+"/api/chests/?lat=" + latitude_local + "&lng=" + longitude_local , headers={'Authorization': user_token})
	if(r.status_code == 200):
		print("Got some Chests!")
	else:
		print("Error Getting Chests")
		print("exiting...")
		exit(1)

	for chest in r.json():
		if((chest['type']['name'] == "Sapphire Chest" or chest['type']['name'] == "Common Chest") and Credentials.buy_common == 1):
			common_counter = 1
			chest_content(chest['id'],chest['location']['latitude'],chest['location']['longitude'], "Sapphire Chest")
			load_inv()
			#load_profile()
			load_stats()
			Credentials.latitude = chest['location']['latitude']
			Credentials.longitude = chest['location']['longitude']
			time.sleep(random.uniform(4,6))
		elif(chest['type']['name'] == "Tourmaline Chest" and Credentials.buy_legendary == 1 and myInv.keys > 3):
			common_counter = 1
			chest_content(chest['id'],chest['location']['latitude'],chest['location']['longitude'] , "Tourmaline Chest")
			load_inv()
			load_stats()
			Credentials.latitude = chest['location']['latitude']
			Credentials.longitude = chest['location']['longitude']
			time.sleep(random.uniform(4,6))
		elif(chest['type']['name'] == "Amethyst Chest" and Credentials.buy_epics == 1 and myInv.keys > 3):
			common_counter = 1
			chest_content(chest['id'],chest['location']['latitude'],chest['location']['longitude'] , "Amethyst Chest")
			load_inv()
			load_stats()
			Credentials.latitude = chest['location']['latitude']
			Credentials.longitude = chest['location']['longitude']
			time.sleep(random.uniform(4,6))
		elif(chest['type']['name'] == "Emerald Chest" and Credentials.buy_rare == 1 and myInv.keys > 3):
			common_counter = 1
			chest_content(chest['id'],chest['location']['latitude'],chest['location']['longitude'] , "Emerald Chest")
			load_inv()
			load_stats()
			Credentials.latitude = chest['location']['latitude']
			Credentials.longitude = chest['location']['longitude']
			time.sleep(random.uniform(4,6))

	if(common_counter == 0):
		print("But none of them is common\nRandomizing Latitude and Longitude")
		Credentials.latitude = Credentials.latitude + random.uniform(-0.001 , 0.001)
		Credentials.longitude = Credentials.longitude + random.uniform(-0.001 , 0.001)

def chest_content(chestId , c_latitude , c_longitude , type):
 	r = requests.get(api+"/api/chests/" + chestId + "/contents/?lat=" + str(c_latitude) + "&lng=" + str(c_longitude) , headers={'Authorization': user_token})
 	if(r.status_code == 200):
 		print("Chest content done!")
 	else:
 		print("Error getting bonus chest")
 		print("exiting...")
 		exit(1)

 	for frag in myInv.fragments:
 		if "Common" in frag[1] and type == "Sapphire Chest":
 			double_chest(chestId, c_latitude ,c_longitude, type)
 		if "Premium Booster" in frag[1] and type == "Tourmaline Chest" and Credentials.boost_legendary == 1:
 			double_chest(chestId, c_latitude ,c_longitude, type)
 		if "Premium Booster" in frag[1] and type == "Amethyst Chest" and Credentials.boost_epic == 1:
 			double_chest(chestId, c_latitude ,c_longitude, type)
 		if "Premium Booster" in frag[1] and type == "Emerald Chest" and Credentials.boost_rare == 1:
 			double_chest(chestId, c_latitude ,c_longitude, type)

 	save_reward_chest(r.json(),type)

 	print("Trying to Open "  + type + " chest...")
 	time.sleep(random.uniform(1,2))
 	open_chest(chestId, c_latitude ,c_longitude, type)


def double_chest(chestId , c_latitude , c_longitude , type):
	r = requests.post(api+"/api/chests/" + chestId + "/double/", headers={'Authorization': user_token})

	if(r.status_code == 200):
 		print("Chest doubled!")
	else:
 		print("Error Doubling Chest!")
 		#catching if already doubled

