def get_market():
	r = requests.get(api+"/api/markets/" , headers={'Authorization': user_token})

	if(r.status_code != 200):
		print("Error getting market info\nExiting...")
		exit(1)

	if(myInv.coins > 6500):
		buy_shop(5)


def buy_shop(itemid):
	r = requests.post(api+"/api/markets/trade/" , headers={'Authorization': user_token} , data={'charge_amount': "" , 'offer' : itemid , 'stripe_transation' : ""})

	if(r.status_code == 201):
		if(itemid == 5):
			print("Bought 6500 coins")
		elif(itemid == 22):
			print("Bought Radius")
	else:
		print("Error buying coins")
		print("exiting...")
		exit(1)

	load_inv()

def print_chest_reward(my_json):
	print("#################################################")
	print("Reward:")
	for reward in my_json:
		amount = reward['amount']
		reward_type = reward['loot_type']['name']
		if (reward_type == "Coin"):
			runStats.coins = runStats.coins + amount
		elif(reward_type == "XP"):
			runStats.xp = runStats.xp + amount
		elif(reward_type == "Dust"):
			runStats.dust = runStats.dust + amount
		elif(reward_type == "Common Booster"):
			runStats.common_booster = runStats.common_booster + amount
		elif(reward_type == "Premium Booster"):
			runStats.premium_booster = runStats.premium_booster + amount
		else:
			runStats.fragments.append(reward_type)

		print(reward_type + " - " + str(amount))
	print("#################################################")

def print_run_stats(signum, stack):
	print("-------------------------------------------------------------------------------")
	print("\t\t\t\tRUN STATS:")
	print("Coins: " + str(runStats.coins) + "\nXP: " + str(runStats.xp) + "\nDust: " + str(runStats.dust) + "\nCommon Boosters: " + str(runStats.common_booster) + "\nPremium Booster:" + str(runStats.premium_booster)+ "\nFragments:")
	aux= []
	aux = sorted(aux, key=lambda fragment: fragment)
	for frag in runStats.fragments:
		print(frag)
	print("-------------------------------------------------------------------------------")

def pretty_json(my_json):
	pprint(my_json)

def save_reward_chest(json , type):
	fname = type + "_reward.txt"
	f = open(fname, 'a+')
	f.close()
	f = open(fname, 'r+')
	file_size = f.read()

	if(len(file_size) <= 3):
		aux = []
		print("File doesn't Exists, Writing reward of " + type + " chests")
		for reward in json:
			aux.append(reward['name'])
		aux = sorted(aux, key=lambda fragment: fragment)
		for reward in aux:
			f.write(reward + "\n")

	f.close()

